    // 分层加载时，展开组织树节点时触发
    /**
     * @param {?} parentNode
     * @return {?}
     */
    getOrganizationByParentNode(parentNode) {
        /** @type {?} */
        const param = {
            absOrgType: this.absOrgType,
            parentID: parentNode.id,
            notGetStopOrg: !this.includeStopOrg
        };
        this.apiService.getOrganization(this.absUserOrgUrl, param).subscribe((/**
         * @param {?} res
         * @return {?}
         */
        (res) => {
            if (res && res.data) {
                /** @type {?} */
                const newDatas = [];
                res.data.forEach((/**
                 * @param {?} item
                 * @return {?}
                 */
                item => {
                    if (!this._isInArray(item[this.orgIdField], this.orgIdField, this.originalTreeData.data)) {
                        item.selectable = true;
                        this.originalTreeData.data.push(item);
                        newDatas.push(item);
                    }
                }));
                /** @type {?} */
                const nodes = this.dealData(newDatas, res.curAbsUser.defaultOrgPath);
                this.farrisTree.appendChildren(nodes, parentNode);
            }
        }));
    }
