    // 分层加载组织左侧树，打开页面的时候，再去发送请求
    /**
     * @return {?}
     */
    hlAssembleTreeData() {
        /** @type {?} */
        const param = {
            absOrgType: this.absOrgType,
            notGetStopOrg: !this.includeStopOrg
        };
        /** @type {?} */
        let currentOrgPath = '';
        if (!!this.orgId && this.orgId !== '*') {
            param.id = this.orgId;
            param.getOrgAllPathInfo = true;
        }
        else {
            param.layer = 1;
        }
        this.apiService.getOrganization(this.absUserOrgUrl, param).subscribe((/**
         * @param {?} res
         * @return {?}
         */
        (res) => {
            if (!res || !res.data) {
                return;
            }
            if (!this.orgId || this.orgId === '*') {
                res.data.forEach((/**
                 * @param {?} item
                 * @return {?}
                 */
                item => {
                    item.selectable = true;
                }));
            }
            else {
                res.data.forEach((/**
                 * @param {?} item
                 * @return {?}
                 */
                item => {
                    if (item[this.orgIdField] === this.orgId) {
                        item.selectable = true;
                        currentOrgPath = item.path;
                    }
                }));
            }
            this.originalTreeData = res;
            if (res && res.curAbsUser && res.curAbsUser.orgAllPathInfo && (!this.orgId || this.orgId === '*')) {
                /** @type {?} */
                const curUserOrgPath = res.curAbsUser.orgAllPathInfo;
                curUserOrgPath.forEach((/**
                 * @param {?} item
                 * @return {?}
                 */
                item => {
                    if (!this._isInArray(item[this.orgIdField], this.orgIdField, res.data)) {
                        res.data.push(item);
                    }
                }));
            }
            this.treeListData = this.dataToTree(res.data, 1, currentOrgPath ? currentOrgPath : res.curAbsUser.defaultOrgPath);
            this.orgIdOrg = res.curAbsUser.defaultOrgId;
            this.pathOrg = res.curAbsUser.defaultOrgPath;
            this.orgId = this.orgId ? this.orgId : res.curAbsUser.defaultOrgId;
            this.path = this.orgPath ? this.orgPath : res.curAbsUser.defaultOrgPath;
            this.initFavorites();
            this.datagridLoad();
            this.cdRef.detectChanges();
            this.farrisTree.selectNode(this.orgId);
        }));
    }
    // 全加载组织左侧树，打开页面的时候，再去发送请求
    /**
     * @return {?}
     */
    assembleTreeData() {
        /** @type {?} */
        const param = {
            absOrgType: this.absOrgType,
            notGetStopOrg: !this.includeStopOrg
        };
        this.apiService.getOrganization(this.absUserOrgUrl, param).subscribe((/**
         * @param {?} res
         * @return {?}
         */
        (res) => {
            this.originalTreeData = res;
            if (this.orgId && this.orgId !== '*') {
                this.assembleCustomTreeData(this.originalTreeData.data, this.orgId);
            }
            else {
                this.treeListData = this.dataToTree(res.data, 1, res.curAbsUser.defaultOrgPath);
            }
            this.orgIdOrg = res.curAbsUser.defaultOrgId;
            this.pathOrg = res.curAbsUser.defaultOrgPath;
            this.orgId = this.orgId ? this.orgId : res.curAbsUser.defaultOrgId;
            this.path = this.orgPath ? this.orgPath : res.curAbsUser.defaultOrgPath;
            this.currentUserId = res.curAbsUser.userId;
            this.initFavorites();
            this.datagridLoad();
            this.cdRef.detectChanges();
            if (this.orgId == '*' || this.orgId == '') {
                // 兼容工作流在原生js页面内打开选人组件场景 2022.3.24
                this.farrisTree.clearSelections();
                this.farrisTree['cdRef']['detectChanges']();
            }
            else {
                this.farrisTree.selectNode(this.orgId);
            }
        }));
    }
    // 分层加载用户分组左侧树，打开页面的时候，再去发送请求
    /**
     * @return {?}
     */
    hlAssembleSysUserGroupTreeData() {
        /** @type {?} */
        let currentPath = '';
        /** @type {?} */
        let currentNode = {};
        /** @type {?} */
        const requestParam = {};
        if (!!this.userGroupId && this.userGroupId !== '*') {
            requestParam['id'] = this.userGroupId;
        }
        else {
            requestParam['layer'] = 1;
        }
        this.apiService.getSysUserGroup(requestParam).subscribe((/**
         * @param {?} resData
         * @return {?}
         */
        (resData) => {
            if (!resData || resData.length == 0) {
                return;
            }
            if (!this.userGroupId || this.userGroupId === '*') {
                resData.forEach((/**
                 * @param {?} item
                 * @return {?}
                 */
                item => {
                    item.selectable = true;
                }));
                this.originalSysUserGroupTreeData = resData;
            }
            else {
                this.filterSysUserGroupTreeData = [];
                resData.forEach((/**
                 * @param {?} item
                 * @return {?}
                 */
                item => {
                    if (item.id === this.userGroupId) {
                        item.selectable = true;
                        currentPath = item.path;
                        currentNode = item;
                        this.filterSysUserGroupTreeData.push(currentNode);
                    }
                }));
                this.getFilterSysUserGroupData(resData, currentNode, this.filterSysUserGroupTreeData);
                this.originalSysUserGroupTreeData = this.filterSysUserGroupTreeData;
            }
            this.sysUserGroupTreeListData = this.sysUserGroupDataToTree(this.originalSysUserGroupTreeData, 1, currentPath ? currentPath : '');
            this.initFavorites();
            this.datagridLoad();
            this.cdRef.detectChanges();
            if (!!this.userGroupId && this.userGroupId !== '*') {
                this.sysUserGroupTree.selectNode(this.userGroupId);
            }
            else {
                this.sysUserGroupTree.selectNode(this.sysUserGroupTreeListData[0].data.id);
            }
        }));
    }
