    // 返回已经该节点是否展开过
    // 通过搜索定位组织树（用户分组树）的某个节点时，并且是分层加载的情况下才会被调用
    /**
     * @private
     * @param {?} item
     * @param {?} arr
     * @param {?} expanded
     * @return {?}
     */
    nodeExpanded(item, arr, expanded) {
        for (let i = 0; i < arr.length; i++) {
            if (item.data.id === arr[i].data.id) {
                expanded[0] = arr[i].expanded;
            }
            else if (arr[i].children.length) {
                this.nodeExpanded(item, arr[i].children, expanded);
            }
        }
    }
    // 通过搜索定位组织树的某个节点时，并且是分层加载的情况下才会被调用
    /**
     * @private
     * @param {?} plainSource
     * @param {?} layer
     * @param {?} userPath
     * @return {?}
     */
    hlDataToTree(plainSource, layer, userPath) {
        /** @type {?} */
        const treeSource = this.hlDealData(plainSource, userPath);
        /** @type {?} */
        const parents = treeSource.filter((/**
         * @param {?} item
         * @return {?}
         */
        item => {
            return item.data.layer === layer;
        }));
        this.treeData(parents, treeSource, 1);
        return parents;
    }
