    // 切换tab页时触发
    /**
     * @param {?} e
     * @return {?}
     */
    changeTabs(e) {
        if (!this.searchText) {
            this.searchPage = false;
        }
        if (!this.hideSearchPanel) {
            this.hideSearchPanel = true;
        }
        if (e.nextId === this.organizationTabId) {
            this.unSelectDatagrid.selections = _.cloneDeep(this.selections);
            this.unSelectDatagrid.filterId = this.filterId;
            this.unSelectDatagrid.switchPage({
                pageIndex: 1,
                pageSize: this.unSelectDatagrid.pageSize ? this.unSelectDatagrid.pageSize : this.pageSize
            });
        }
        else if (e.nextId === this.sysUserGroupTabId) {
            this.sysUserGroupUnselect.selections = _.cloneDeep(this.selections);
            this.sysUserGroupUnselect.filterId = this.filterId;
            if (this.showOrgFilterIcon) {
                this.orgFilterComboList && this.orgFilterComboList.displayText && this.orgFilterComboList.onClear();
                this.sysUserGroupUnselect.assembleDataByUserGroupIdAndGetFilterOrg({
                    pageIndex: 1,
                    pageSize: this.unSelectDatagrid.pageSize ? this.unSelectDatagrid.pageSize : this.pageSize
                });
            }
            else {
                this.sysUserGroupUnselect.switchPage({
                    pageIndex: 1,
                    pageSize: this.unSelectDatagrid.pageSize ? this.unSelectDatagrid.pageSize : this.pageSize
                });
            }
        }
        else if (e.nextId === this.candidateTabId) {
            this.candidateDatagrid.selections = _.cloneDeep(this.selections);
            this.candidateDatagrid.assembleData();
        }
        else if (e.nextId === this.recentTabId) {
            this.recentContactsComponent.selections = _.cloneDeep(this.selections);
            this.recentContactsComponent.assembleData();
        }
        else if (e.nextId === this.favoritesTabId) {
            this.favoritesComponent.selections = _.cloneDeep(this.selections);
            this.favoritesComponent.assembleData();
        }
        else if (e.nextId === this.groupTabId) {
            this.groupComponent.selections = _.cloneDeep(this.selections);
            this.groupComponent.assembleData();
        }
    }
    /**
     * input框标签删除逻辑 todo 强依赖用户编号唯一
     * @param {?} item
     * @return {?}
     */
    onRemoveSelectItem(item) {
        /** @type {?} */
        const currentIndex = this.finalText.findIndex((/**
         * @param {?} text
         * @return {?}
         */
        text => text === item));
        this.finalText.splice(currentIndex, 1);
        /** @type {?} */
        let currentItem;
        this.selections.forEach((/**
         * @param {?} selection
         * @param {?} index
         * @return {?}
         */
        (selection, index) => {
            if (index === currentIndex) {
                currentItem = selection;
                this.selections.splice(index, 1);
            }
        }));
        this.cloneSelections = _.cloneDeep(this.selections);
        this.componentMap.forEach((/**
         * @param {?} component
         * @param {?} key
         * @param {?} map
         * @return {?}
         */
        (component, key, map) => {
            component.selections = _.cloneDeep(this.selections);
            component.cloneSelections = _.cloneDeep(this.selections);
            component.userIds = '';
            component.cloneUserIds = '';
            if (!!currentItem) {
                component.cancelSelections({ id: currentItem[this.idField] });
            }
        }));
        // 关联或udt先出非主键的
        this.onModelChange(this.finalText.join());
        this.onModelTouched(this.finalText.join());
        this.tagRemoved.emit({
            deleteItem: item,
            deleteIndex: currentIndex,
            selections: this.selections
        });
        if (this.enableQuick) {
            this.setQuickContainerWidth();
        }
    }
