    // 打开人员选择弹窗
    /**
     * @return {?}
     */
    farrisDialogshow() {
        if ((!!this.userIds && this.userIds.includes(',') && !this.multiSelect) || (this.selections.length > 1 && !this.multiSelect)) {
            this.msgService.show('warning', '单选模式下预置了多条选中数据，请修改！', {
                height: 140,
                showHeader: false
            });
            return;
        }
        if (!this.hasSetGlobalConfigParam) {
            /** @type {?} */
            const requestUrl = '/api/runtime/sys/v1.0/personnel-selector-param';
            this.apiService.getGlobalParamConfig(requestUrl).subscribe((/**
             * @param {?} res
             * @return {?}
             */
            (res) => {
                if (res) {
                    this.setGlobalConfigParam(res);
                    this.hasSetGlobalConfigParam = true;
                    this.showPersonnelSelectorDialog();
                }
            }));
        }
        else {
            this.showPersonnelSelectorDialog();
        }
    }
