    // 筛选框关闭，是否过滤领导场景使用
    /**
     * @param {?} token
     * @return {?}
     */
    dialogFilterclose(token) {
        this.dialogFilter.close();
        if (this.selectTabs.activeId == this.organizationTabId) {
            if (token) {
                /** @type {?} */
                const oldGroupLeaderStatus = this.pIncludeGroupLeader ? '1' : '2';
                this.pIncludeGroupLeader = this.includeGroupLeader;
                /** @type {?} */
                const currentGroupLeaderStatus = this.pIncludeGroupLeader ? '1' : '2';
                /** @type {?} */
                const param = {
                    absOrgType: this.absOrgType,
                    bizId: this.filterId,
                    objectValue: 'FilterUser',
                    deleteList: [oldGroupLeaderStatus],
                    addList: [currentGroupLeaderStatus]
                };
                this.apiService.filterGroupLeader(param).subscribe((/**
                 * @return {?}
                 */
                () => {
                    this.changeisExclude();
                }));
            }
            else {
                this.includeGroupLeader = this.pIncludeGroupLeader;
            }
        }
        else if (this.selectTabs.activeId == this.sysUserGroupTabId) {
            if (token) {
                this.sysUserGroupUnselect.assembleDataByUserGroupId();
            }
        }
    }
